package main

import (
	"fmt"
	"strings"
)

func main(){
	
	var moveSet = string(`



`)
	var digiCode = [3][3]int{   {1,2,3},
		{4,5,6},
		{7,8,9}}

	var moveSetArray = strings.Split(moveSet, "\n")

	for _,elem := range moveSetArray{
		var x int = 1
		var y int = 1
		for  i :=0; i < len(elem); i++{
			switch string(elem[i]){
			case "R":
				if x < 2{
					x++}
				break
			case "U":
				if y > 0{
					y--
				}
				break
			case "L":
				if x >0{
					x--
				}
				break
			case "D":
				if y < 2{
					y++
				}
				break
			}	
		}
		fmt.Println(digiCode[y][x])
	}


	fmt.Printf("Hello")
}
 
